class RNBOSubpatcher_327 {
	constructor() {
		this.codebox_tilde_01_in1 = 0;
		this.codebox_tilde_01_duration = 2200;
		this._currentTime = 0;
		this.audioProcessSampleCount = 0;
		this.sampleOffsetIntoNextAudioBuffer = 0;
		this.zeroBuffer = 0;
		this.dummyBuffer = 0;
		this.didAllocateSignals = 0;
		this.vs = 0;
		this.maxvs = 0;
		this.sr = 44100;
		this.invsr = 0.00002267573696;
		this.codebox_tilde_01_status = 0;
		this.codebox_tilde_01_change_prev = 0;
		this.stackprotect_count = 0;
		this._voiceIndex = 0;
		this._noteNumber = 0;
		this.isMuted = 1;
		this.parameterOffset = 0;
	} // end constructor
	getNumMidiInputPorts() {
	    return 0;
	}
	processMidiEvent(time, port, data, length) {}
	getNumMidiOutputPorts() {
	    return 0;
	}
	process(inputs, numInputs, outputs, numOutputs, n) {
	    this.vs = n;
	    this.updateTime(this.getEngine().getCurrentTime());
	    var out1 = (numOutputs >= 1 && outputs[0] ? outputs[0] : this.dummyBuffer);
	    var in1 = (numInputs >= 1 && inputs[0] ? inputs[0] : this.zeroBuffer);
	    this.codebox_tilde_01_perform(in1, this.codebox_tilde_01_duration, out1, n);
	    this.stackprotect_perform(n);
	    this.audioProcessSampleCount += this.vs;
	}
	prepareToProcess(sampleRate, maxBlockSize, force) {
	    if (this.maxvs < maxBlockSize || !this.didAllocateSignals) {
	        this.zeroBuffer = resizeSignal(this.zeroBuffer, this.maxvs, maxBlockSize);
	        this.dummyBuffer = resizeSignal(this.dummyBuffer, this.maxvs, maxBlockSize);
	        this.didAllocateSignals = true;
	    }

	    var sampleRateChanged = sampleRate != this.sr;
	    var maxvsChanged = maxBlockSize != this.maxvs;
	    var forceDSPSetup = sampleRateChanged || maxvsChanged || force;

	    if (sampleRateChanged || maxvsChanged) {
	        this.vs = maxBlockSize;
	        this.maxvs = maxBlockSize;
	        this.sr = sampleRate;
	        this.invsr = 1 / sampleRate;
	    }

	    RNBO_UNUSED(forceDSPSetup);

	    if (sampleRateChanged)
	        this.onSampleRateChanged(sampleRate);
	}
	msToSamps(ms, sampleRate) {
	    return ms * sampleRate * 0.001;
	}
	sampsToMs(samps) {
	    return samps * (this.invsr * 1000);
	}
	getMaxBlockSize() {
	    return this.maxvs;
	}
	getSampleRate() {
	    return this.sr;
	}
	hasFixedVectorSize() {
	    return false;
	}
