	    this.setParameterValue(index, value, time);
	}
	processNormalizedParameterEvent(index, value, time) {
	    this.setParameterValueNormalized(index, value, time);
	}
	getParameterValue(index) {
	    switch (index) {
	    default:
	        return 0;
	    }
	}
	getNumSignalInParameters() {
	    return 0;
	}
	getNumSignalOutParameters() {
	    return 0;
	}
	getNumParameters() {
	    return 0;
	}
	getParameterName(index) {
	    switch (index) {
	    default:
	        return "bogus";
	    }
	}
	getParameterId(index) {
	    switch (index) {
	    default:
	        return "bogus";
	    }
	}
