	    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

	    switch (index) {
	    default:
	        return value;
	    }
	}
	constrainParameterValue(index, value) {
	    switch (index) {
	    default:
	        return value;
	    }
	}
	scheduleParamInit(index, order) {
	    this.getPatcher().scheduleParamInit(index + this.parameterOffset, order);
	}
	processClockEvent(time, index, hasValue, value) {}
	processOutletAtCurrentTime(sender, index, value) {}
	processOutletEvent(sender, index, value, time) {
	    this.updateTime(time);
	    this.processOutletAtCurrentTime(sender, index, value);
	}
	sendOutlet(index, value) {
	    this.getEngine().sendOutlet(this, index, value);
	}
	processNumMessage(tag, objectId, time, payload) {}
	processListMessage(tag, objectId, time, payload) {}
	processBangMessage(tag, objectId, time) {}
	resolveTag(tag) {
	    switch (tag) {

	    }

	    return null;
	}
	startup() {}
	getDataRef(index) {
	    switch (index) {
	    default:
	        return null;
	    }
	}
	getNumDataRefs() {
	    return 0;
	}
	fillDataRef(index, ref) {}
	processDataViewUpdate(index, time) {}
	allocateDataRefs() {}
	initialize() {
	    this.assign_defaults();
	    this.setState();
	}
	codebox_tilde_01_perform(in1, duration, out1, n) {
	    var __codebox_tilde_01_status = this.codebox_tilde_01_status;
	    var i;

	    for (i = 0; i < n; i++) {
	        let increment = 1 / 2200;

	        if (__codebox_tilde_01_status <= 0 && this.codebox_tilde_01_change_next(in1[i]) == 1) {
	            __codebox_tilde_01_status = 1;//#map:_###_obj_###_:8
	        } else if (__codebox_tilde_01_status > 0) {
	            __codebox_tilde_01_status = __codebox_tilde_01_status - increment;//#map:_###_obj_###_:10
	        }//#map:_###_obj_###_:9//#map:_###_obj_###_:7

	        out1[i] = __codebox_tilde_01_status == 1;//#map:_###_obj_###_:13
	    }

	    this.codebox_tilde_01_status = __codebox_tilde_01_status;
	}
	stackprotect_perform(n) {
	    var __stackprotect_count = this.stackprotect_count;
	    __stackprotect_count = 0;
	    this.stackprotect_count = __stackprotect_count;
	}
	codebox_tilde_01_change_next(x) {
	    var temp = x - this.codebox_tilde_01_change_prev;
	    this.codebox_tilde_01_change_prev = x;
	    return (temp > 0. ? 1. : (temp < 0. ? -1. : 0));
	}
	codebox_tilde_01_change_init() {
	    this.codebox_tilde_01_change_prev = 0;
	}
	codebox_tilde_01_change_reset() {
	    this.codebox_tilde_01_change_prev = 0;
	}
	stackprotect_check() {
	    this.stackprotect_count++;

	    if (this.stackprotect_count > 128) {
	        console.log("STACK OVERFLOW DETECTED - stopped processing branch !");
	        return true;
	    }

	    return false;
	}
	updateTime(time) {
	    this._currentTime = time;
	    this.sampleOffsetIntoNextAudioBuffer = (rnbo_fround(this.msToSamps(time - this.getEngine().getCurrentTime(), this.sr)));

	    if (this.sampleOffsetIntoNextAudioBuffer >= (this.vs))
	        this.sampleOffsetIntoNextAudioBuffer = (this.vs) - 1;

	    if (this.sampleOffsetIntoNextAudioBuffer < 0)
	        this.sampleOffsetIntoNextAudioBuffer = 0;
	}
	assign_defaults() {}
	setEngineAndPatcher(engineInterface, parentPatcher) {
	    this._engineInterface = engineInterface;
	    this._parentPatcher = parentPatcher;
	}
	getEngine() {
	    return this._engineInterface;
	}
	getPatcher() {
	    return this._parentPatcher;
	}
	getTopLevelPatcher() {
	    return this.getPatcher().getTopLevelPatcher();
	}
} // end class


